import { StyleSheet, Text, View } from 'react-native';
const Height  = Dimensions.get("window").height;
import React from 'react';

const CardMain = () => {
  return (
    <View style={styles.card}>
      <Text></Text>
    </View>
  );
};

export default CardMain;

const styles = StyleSheet.create({
    card: {
        backgroundColor:'red',
        width:50,
        height:50,
    }
});
